import React from 'react';

function Hero() {
  return (
    <div className="hero">
      <h1>Películas y series ilimitadas y mucho más.</h1>
      <p>Disfruta donde quieras. Cancela en cualquier momento.</p>
      <p>¿Quieres ver algo ya? Escribe tu direción de correo para crear una suscripcion a netflix o reactivarla.</p>
      <button>Empezar</button>
    </div>
  );
}

export default Hero;
